import React, { Component } from 'react'
import { Fragment } from 'react'
import dataCar from "../carsData/carsData.json";

export class CarSignleAudi1 extends Component {
    render() {
        return (
            <Fragment>
                <div className="container mb-5 mt-5">
                    <div className="row">
                        <img src={dataCar[0].img} alt={dataCar[0].name} />
                    </div>
                </div>
            </Fragment>
        )
    }
}

export default CarSignleAudi1
